import SubTitle from "../../../../UI/SubTitle/SubTitle";
import InputCheckbox from "../../../../UI/InputCheckbox/InputCheckbox";

import style from "./OptionCheckbox.module.css";

function OptionCheckboxExpense(props) {
  function checkboxChangeHandler(e) {
    props.dispatchChartData({
      type: "SUB_CATEGORY",
      value: e.target.value,
      check: e.target.checked,
    });
  }

  return (
    <div className={style.checkbox}>
      <SubTitle className={style["subTitle--blue"]}>Select Sub Data</SubTitle>
      <div className={style["checkbox__container"]}>
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="food"
          label="Food"
          value="food"
          defaultChecked={true}
          onChange={checkboxChangeHandler}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="transportation"
          label="Transportation"
          value="transportation"
          defaultChecked={true}
          onChange={checkboxChangeHandler}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="clothing"
          label="Clothing"
          value="clothing"
          defaultChecked={true}
          onChange={checkboxChangeHandler}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="entertainment"
          label="Entertainment"
          value="entertainment"
          defaultChecked={true}
          onChange={checkboxChangeHandler}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="housing"
          label="Housing"
          value="housing"
          defaultChecked={true}
          onChange={checkboxChangeHandler}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="others"
          label="Others"
          value="others"
          defaultChecked={true}
          onChange={checkboxChangeHandler}
        />
      </div>
    </div>
  );
}

export default OptionCheckboxExpense;
